 public EnumStringMultiSelectionDialog(String displayName, Collection<String> enums, Collection<String> selEnums) {  super(Display.getCurrent().getActiveShell(), new StringLabelProvider(), new ArrayTreeContentProvider());  setTitle(XViewerText.get("EnumStringMultiSelectionDialog.title")+ " " + displayName);    setMessage(String.format(XViewerText.get("EnumStringMultiSelectionDialog.message"), displayName));   setInput(enums);  setComparator(new StringViewerSorter());  setInitialSelections(selEnums.toArray());    } 
